  static getInitialProps(ctx) {
    return loadGetInitialProps(Composed, ctx)
  }

  componentDidMount() {
    ReactGA.initialize('UA-123123123-br');
    ReactGA.pageview(window.location.pathname);
  }

  render() {
    return <Composed {...this.props} />
  }
}
